import React from "react";
import './homeMain.css';

function HomeMain(){
    return(
        <div className="home">
            <h4>I'm</h4>
            <h1 className="name">Joaquin Sanchez Tonani</h1>
            <h2>Programmer</h2>
            <h2>and web developer</h2>
        </div>
    )
};

export default HomeMain;
